import React, { useState } from "react";
import WhoIWasPage from "../../pages/WhoIWasPage";
import MyWayPage from "../../pages/MyWayPage";
import WhatIKnowPage from "../../pages/WhatIKnowPage";
import MySoftSkills from "../../pages/MySoftSkills";

const NewSlider: React.FC = () => {
  const [numberSlide, setNumberSlide] = useState<number>(1);

  return (
    <div>
        {numberSlide === 1}
      <WhoIWasPage numberSlide={numberSlide} setNumberSlide={setNumberSlide} />
      <div className="icons">
        <div className="icon">Arrow Left</div>
        <div className="icon">Arrow Right</div>
      </div>
    </div>
  );
};

export default NewSlider;
